import styled from "styled-components";

export const Card = styled.div`
  background: ${(props) => props.theme.colors.cardBackground};
`;

export const Username = styled.div`
  color: ${(props) => props.theme.colors.text};
  font-weight: 700px;
  font-size: 12px;
`;
